Suidheachadh obrach
1. Cha bu chòir an ìre as àirde de theodhachd èadhair àrainneachdail a bhith nas àirde na + 40 ℃, cha bu chòir an ìre as ìsle a bhith nas ìsle na -5 ℃, agus cha bu chòir an teòthachd cuibheasach de 24 uairean a bhith nas àirde na + 35 ℃;
Nota 1: Is e a ’chrìoch as ìsle -10 ° C no -25 ° C cumhaichean obrach, feumaidh an neach-cleachdaidh innse don neach-dèanamh nuair a tha e ag òrdachadh;
Nota 2: Airson cumhaichean obrach far a bheil a ’chrìoch as àirde os cionn + 40 ° C no ma
... 
l airson dùmhlachd;
4. Ìre truailleadh: Ìre 2;
5. Roinn stàlaidh: Seòrsa Ⅱ agus Seòrsa Ⅲ;
6. Cha bu chòir an raon magnetach taobh a-muigh làrach an stàlaidh a bhith nas àirde na 5 uiread an raon geomagnetic ann an stiùireadh sam bith;
7. Mar as trice air a chuir a-steach gu dìreach, le fulangas 2 ° ann an stiùireadh sam bith;
Breaker Circuit Miniature
Briseadh-cuairteachaidh beag (4 dealbhan)
8. Cha bu chòir buaidh agus crathadh mòr sam bith a bhith aig an àite stàlaidh
Modh pàighidh: tasgadh 30
...
i còmhdhail mara port Ningbo no còmhdhail adhair Shanghai
Thoir seachad uidheamachadh, is urrainn dhaibh toraidhean a ghnàthachadh a rèir riatanasan luchd-ceannach
Faodar sampaill a thoirt seachad, chan fheumar barrachd air 3 sampaill de gach sònrachadh, agus feumar cìsean sampall agus cosgaisean luingeis a phàigheadh
Faodaidh gealltanas càileachd seirbheis às-dèidh bliadhna a thoirt seachad
Is e an àite tùsail Wenzhou, Zhejiang, Sìona
Tha an stuth a chaidh a dhèanamh den toradh lasair-retardant
